  const cookies = new Cookies();
  var userEmail = cookies.get("email");

  const getHistory = () => {
    let userDetails = {
      email: userEmail,
    };
    fetch("http://localhost:4000/getHistory", {
      method: "POST",
      body: JSON.stringify(userDetails),
      headers: { "Content-Type": "application/json" },
    })
