    getHistory();
  }, []);

  return (
    <div>
      <Table striped bordered hover className="tableHistory">
        <thead>
          <tr>
            <th>#</th>
            <th>Wine Names</th>
            <th>Amount & Price</th>
            <th>Order Date</th>
            <th>Shipping Date</th>
            <th>Address</th>
            <th>Payment Kind</th>
            <th>Extra Details</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1</td>
